import React from 'react'

function Display() {
  return (
    <div className='w-full'>
        <div className='flex justify-between items-center bg-slate-400 text-yellow-200 p-3 rounded-lg shadow-lg shadow-red-600 shadow-1'>
          <h1 id="display-content" className='text-2xl font-semibold'>PASSWORD</h1>
          <img className='w-6 h-6' src={process.env.PUBLIC_URL + '/copy-icon.png'} alt="copy" />
        </div>
    </div>
  )
}

export default Display
